import React from "react";
import { ListItemText, Link, Typography, Button } from "@mui/material";

function Program() {
  return (
    <div
      id="item_3"
      className="Program"
      style={{ textAlign: "center", height: "40vh" }}
    >
      <Typography variant="h4" style={{ textAlign: "center" }}></Typography>
      <Typography></Typography>
      <ListItemText
        primary="プログラム"
        primaryTypographyProps={{
          color: "#222222",
          variant: "h4",
          textAlign: "center",
        }}
        secondary="大会の概要およびプログラムを下記からダウンロードできます。"
        secondaryTypographyProps={{
          color: "red",
          variant: "h6",
          textAlign: "center",
        }}
      />
      <Button variant="contained" size="large">
        <Link href="src\dawnload\img.png" download="img.png">
          <Typography style={{ color: "white" }}>
            サンプルCSVダウンロード
          </Typography>
        </Link>
      </Button>
    </div>
  );
}

export default Program;
